    public function __construct(
        private SerializerInterface $serializer,
        private EntityManagerInterface $entityManager,
        private ItemRepositoryInterface $itemRepository,
    ) {
        parent::__construct();
    }

    protected function execute(InputInterface $input, OutputInterface $output): int
    {
        /** @var Item $weapon */
        foreach ($this->serializer->deserialize(self::WEAPONS, Item::class . '[]', 'json') as $weapon) {
            if ($this->itemRepository->findOneBy(['identifier' => $weapon->getIdentifier()])) {
                continue;
            }

            $weapon->setType(Item::WEAPON_TYPE);
            $this->entityManager->persist($weapon);
        }

        /** @var Item $armor */
        foreach ($this->serializer->deserialize(self::ARMORS, Item::class . '[]', 'json') as $armor) {
            if ($this->itemRepository->findOneBy(['identifier' => $armor->getIdentifier()])) {
                continue;
            }

            $this->entityManager->persist($armor);
        }

        /** @var Item $shield */
        foreach ($this->serializer->deserialize(self::SHIELDS, Item::class . '[]', 'json') as $shield) {
            if ($this->itemRepository->findOneBy(['identifier' => $shield->getIdentifier()])) {
                continue;
            }

            $shield->setType(Item::SHIELD_TYPE);
            $this->entityManager->persist($shield);
        }

        $this->entityManager->flush();

        return Command::SUCCESS;
    }
